const Profile = () => {
  return (
    <div className="profile">
      <Layout>
        <Sider width={200} className="site-layout-background">
         
        </Sider>
        <Content className="site-layout-background">Content</Content>
      </Layout>
    </div>
  );
};

export default Profile;
